/* eslint-disable import/no-anonymous-default-export */
export default (props) =>{
    return(

<div class="row g-0">
  <div class="col-md-4">
    <img src={props.Foto} class="img-fluid rounded-start" alt="..."/>
  </div>
  <div class="col-md-8">
    <div class="card-body">
      <h5 class="card-title">Beach Park Fortaleza, Passeio Pra Toda Familia!!!!</h5>
      <p class="card-text">O Beach Park reúne mais de 18 atrações inesquecíveis, classificadas em radicais, moderadas e para toda a família.
       Mais de 7.793.000 litros de água garantem muita diversão e adrenalina aos visitantes.
       Além da segurança e qualidade das nossas atrações, é impossível não notar toda a atmosfera do lugar. 
       E a praia, além de trazer boa energia, também é um diferencial.
       Somos um dos poucos parques aquáticos à beira-mar no mundo.</p>    
    </div>
  </div>
  </div>
  


    );
    }
